import React from 'react';
import Faq from 'react-faq-component';

const data = {
  rows: [
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">Урок 1</span> Вводный урок
        </p>
      ),
      content:
        'Жизненный цикл проекта. Что такое ноды? Какие бывают награды? Почему стоит ставить ноды?',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">Урок 2</span> Какие нужны сервисы для нод
        </p>
      ),
      content: 'Взаимодействие с Discord, Medium, Twitter, YouTube, Telegram',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">Урок 3</span> Что нужно чтоб ставить
          ноды?
        </p>
      ),
      content:
        'Как арендовать сервер? Как зайти на сервер? Как пользоваться терминалом? Где брать гайды?      ',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">Урок 4</span> Вводный урок
        </p>
      ),
      content: 'Lorem ipsum dolor sit amet, consectetur ',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">Урок 5</span> Вводный урок
        </p>
      ),
      content: 'Lorem ipsum dolor sit amet, consectetur ',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">Урок 6</span> Вводный урок
        </p>
      ),
      content: 'Lorem ipsum dolor sit amet, consectetur ',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">Урок 7</span> Вводный урок
        </p>
      ),
      content: 'Lorem ipsum dolor sit amet, consectetur ',
    },
  ],
};

const СourseContent = () => {
  return (
    <div className="p-10 md-p-l5">
      <h1 className="white fs-l3 lh-2 md-fs-l1 md-lh-1 fw-600 text-center">Что в нашем курсе</h1>
      <Faq
        data={data}
        styles={{
          bgColor: 'transparent',
          titleTextColor: 'white',
          rowTitleColor: '#78789a',
          rowTitleTextSize: 'large',
          rowContentColor: '#48484a',
          rowContentTextSize: '16px',
          rowContentPaddingTop: '10px',
          rowContentPaddingBottom: '10px',
          rowContentPaddingLeft: '50px',
          rowContentPaddingRight: '150px',
          arrowColor: '#5A4FCF',
        }}
        config={{
          animate: true,
          expandIcon: '+',
          collapseIcon: '-',
        }}
      />
    </div>
  );
};

export default СourseContent;
